from PIL import Image

def rgb888_to_image(data, width, height, output_path):
    # 确保数据长度正确
    if len(data) != width * height * 3:
        raise ValueError("Data length does not match image size")

    # 将 RGB888 数据转换为 (R, G, B) 元组列表
    rgb888_data = [(data[i], data[i+1], data[i+2]) for i in range(0, len(data), 3)]
    
    # 创建图片
    image = Image.new("RGB", (width, height))
    image.putdata(rgb888_data)
    
    # 保存图片
    image.save(output_path)

